import React, { useState } from "react";
import "./Home.css";
import Dashboard from "../Dashboard/Dashboard";

// Bangladesh hierarchy: Division -> District -> Upazilas
const locations = {
  Dhaka: {
    Dhaka: ["Savar", "Dhamrai", "Dohar"],
    Gazipur: ["Tongi", "Kaliakoir", "Kapasia"],
    Narayanganj: ["Araihazar", "Rupganj", "Sonargaon"]
  },
  Chattogram: {
    Chattogram: ["Patiya", "Fatikchhari", "Rangunia"],
    CoxsBazar: ["Cox's Bazar Sadar", "Ukhiya", "Teknaf"],
    Comilla: ["Comilla Sadar", "Barura", "Daudkandi"]
  },
  Rajshahi: {
    Rajshahi: ["Paba", "Bagha", "Tanore"],
    Bogra: ["Bogra Sadar", "Sariakandi", "Shibganj"]
  },
  Khulna: {
    Khulna: ["Batiaghata", "Dumuria", "Terokhada"],
    Jessore: ["Jessore Sadar", "Chaugachha", "Abhaynagar"]
  }
  // Add remaining 4 divisions (Barishal, Sylhet, Rangpur, Mymensingh)
};

const Home = () => {
  const [selectedDivision, setSelectedDivision] = useState("Dhaka");
  const [selectedDistrict, setSelectedDistrict] = useState(
    Object.keys(locations["Dhaka"])[0]
  );
  const [selectedUpazila, setSelectedUpazila] = useState(
    locations["Dhaka"][Object.keys(locations["Dhaka"])[0]][0]
  );

  const [searchCity, setSearchCity] = useState("Dhaka"); // default search
  const [inputCity, setInputCity] = useState("");

  const handleSearch = () => {
    if (inputCity.trim()) {
      setSearchCity(inputCity.trim());
      setInputCity(""); // clear manual input
    } else {
      setSearchCity(`${selectedUpazila}, ${selectedDistrict}`);
    }
  };

  return (
    <main id="home" className="home">
      <header className="home__header">
        <h1 className="home__title">
          Welcome to <span className="home__highlight">WeatherMate</span> üå¶Ô∏è‚òÅÔ∏è
        </h1>
        <p className="home__subtitle">
          Check live weather in your city, district, or upazila!
        </p>

        <div className="home__search">
          {/* Manual Search */}
          <input
            type="text"
            placeholder="Or enter city/upazila..."
            value={inputCity}
            onChange={(e) => setInputCity(e.target.value)}
            className="home__input"
            onKeyDown={(e) => e.key === "Enter" && handleSearch()}
          />

          {/* Division Dropdown */}
          <select
            value={selectedDivision}
            onChange={(e) => {
              const division = e.target.value;
              setSelectedDivision(division);

              const firstDistrict = Object.keys(locations[division])[0];
              setSelectedDistrict(firstDistrict);
              setSelectedUpazila(locations[division][firstDistrict][0]);
            }}
            className="home__select"
          >
            {Object.keys(locations).map((division) => (
              <option key={division} value={division}>
                {division}
              </option>
            ))}
          </select>

          {/* District Dropdown */}
          <select
            value={selectedDistrict}
            onChange={(e) => {
              const district = e.target.value;
              setSelectedDistrict(district);
              setSelectedUpazila(locations[selectedDivision][district][0]);
            }}
            className="home__select"
          >
            {Object.keys(locations[selectedDivision]).map((district) => (
              <option key={district} value={district}>
                {district}
              </option>
            ))}
          </select>

          {/* Upazila Dropdown */}
          <select
            value={selectedUpazila}
            onChange={(e) => setSelectedUpazila(e.target.value)}
            className="home__select"
          >
            {locations[selectedDivision][selectedDistrict].map((upazila) => (
              <option key={upazila} value={upazila}>
                {upazila}
              </option>
            ))}
          </select>

          <button onClick={handleSearch} className="home__button">
            Search
          </button>
        </div>
      </header>

      {/* Dashboard */}
      <section className="home__dashboard">
        <Dashboard city={searchCity} />
      </section>
    </main>
  );
};

export default Home;
